const categories = <ol className="Categorie-list"><li><button onClick="ActivatePopular()">Popular</button></li><li>New Movies</li><li>Movies</li></ol>

class App extends React.Component{
  render() {
    this.state = {title: <h1 className="App-title">{currentTitle}</h1>}
    let popular = false;
    return (
      <div className="App">
        <header className="App-header">
          {title}
          <a
            className="App-link"
            href="https://themoviedb.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            List API
          </a>

          if (popular){
            {categories}
          }

        </header>
        <body className="App-body">

          <div className="Movie-list">

          </div>

        </body>
      </div>
    );
  }
}

